import React, { Component } from 'react'
import './Nav_top.css';
import Navbar from 'react-bootstrap/Navbar';
import Container from "react-bootstrap/Container";
import 'bootstrap/dist/css/bootstrap.min.css';
import logo from '../../nav-logo.png';
import {Link as Nav} from 'react-scroll'
import {Col, Row} from "reactstrap";



export default class Nav_Top extends Component {
    render() {
        return (
            <Navbar bg="light" variant="light" sticky="top">
                <Container>
                    <Navbar.Brand href="#home"><img
                        src={logo}
                        width="325"
                        height="60"
                        className="d-inline-block align-top"
                        alt="React Bootstrap logo"
                    /></Navbar.Brand>
                            <nav className="me-auto" >
                                <Nav.Link activeClass="active" to="home" spy={true} smooth={true} >Home</Nav.Link>
                                <Nav.Link  to="AboutUS" spy={true} smooth={true} >AboutUS</Nav.Link>
                                <Nav.Link  to="Header" spy={true} smooth={true} >Header</Nav.Link>
                                <Nav.Link  to="News" spy={true} smooth={true} >News</Nav.Link>
                                <Nav.Link  to="Members" spy={true} smooth={true} >TeamMembers</Nav.Link>
                                <Nav.Link  to="Events" spy={true} smooth={true} > Events</Nav.Link>
                            </nav>
                </Container>
            </Navbar>
        )
    }
}
